import React from "react";

const ImageSlider = () => {
  return (
    // <div className="slider-banner row">
    //   <div
    //     className="homeslider-container slideshow-panel"
    //     data-interval="6000"
    //     data-wrap="true"
    //     data-pause="hover"
    //   >
    //     <ul
    //       id="owl-image-slider"
    //       className="image-slide owl-carousel owl-theme owl-loaded owl-drag"
    //     >
    //       {/* Individual Slide Items */}
    //       <div className="owl-stage-outer">
    //         <div
    //           className="owl-stage"
    //           style={{
    //             transform: "translate3d(-11313px, 0px, 0px)",
    //             transition: "all 0s ease 0s",
    //             width: "33939px",
    //           }}
    //         >
    //           {/* Replace this part with your slide content */}
    //         </div>
    //       </div>
    //       {/* Navigation */}
    //       <div className="owl-nav">
    //         <div className="owl-prev">
    //           <i className="fa fa-angle-left"></i>
    //         </div>
    //         <div className="owl-next">
    //           <i className="fa fa-angle-right"></i>
    //         </div>
    //       </div>
    //       {/* Dots */}
    //       <div className="owl-dots disabled"></div>
    //     </ul>
    //   </div>
    // </div>
    <div class="slider-banner row">
      <div
        class="homeslider-container slideshow-panel"
        data-interval="6000"
        data-wrap="true"
        data-pause="hover"
      >
        <ul
          id="owl-image-slider"
          class="image-slide owl-carousel owl-theme owl-loaded owl-drag"
        >
          <div class="owl-stage-outer">
            <div
              class="owl-stage"
              style="transform: translate3d(-11313px, 0px, 0px); transition: all 0s ease 0s; width: 33939px;"
            >
              <div
                class="owl-item cloned"
                style="width: 1227px; margin-right: 30px;"
              >
                <li class="slide">
                  <a href="https://www.tunisianet.com.tn/recherche?controller=search&amp;orderby=price&amp;orderway=asc&amp;s=DW3084NK&amp;submit_search=">
                    <img
                      src="https://www.tunisianet.com.tn/modules/wbimageslider/views/img/f65defcc5c9371455d6a82fd7d3c6c2614ccdb1a_TUNISIANET 1540X460.jpg"
                      width="1540"
                      height="460"
                      alt=""
                      class="img-responsive center-block"
                    />
                  </a>
                </li>
              </div>
              <div
                class="owl-item cloned"
                style="width: 1227px; margin-right: 30px;"
              >
                <li class="slide">
                  <a href="https://www.tunisianet.com.tn/681-pc-portable-gamer?fabricants=msi&amp;order=product.price.asc">
                    <img
                      src="https://www.tunisianet.com.tn/modules/wbimageslider/views/img/1a0d557f92b6a8849da8d21fa123f7a6f3dca66b_pc-gamer-msi.jpg"
                      width="1580"
                      height="460"
                      alt=""
                      class="img-responsive center-block"
                    />
                  </a>
                </li>
              </div>
              <div
                class="owl-item"
                style={{ width: "1227px", marginRight: "30px" }}
              >
                <li class="slide">
                  <a href="https://www.tunisianet.com.tn/recherche?controller=search&amp;orderby=price&amp;orderway=asc&amp;s=REALME-C55&amp;submit_search=">
                    <img
                      src="https://www.tunisianet.com.tn/modules/wbimageslider/views/img/2fe7cedf61c58597615ebe51c8aada5a1390cffb_realme-divers.jpg"
                      width="1580"
                      height="460"
                      alt=""
                      class="img-responsive center-block"
                    />
                  </a>
                </li>
              </div>
            </div>
          </div>
          <div class="owl-nav">
            <div class="owl-prev">
              <i class="fa fa-angle-left"></i>
            </div>
            <div class="owl-next">
              <i class="fa fa-angle-right"></i>
            </div>
          </div>
          <div class="owl-dots disabled"></div>
        </ul>
      </div>
    </div>
  );
};

export default ImageSlider;
